import React, { Component } from 'react';
import './home.css';

import step0 from './download/step0';
import step1 from './download/step1';

class Home extends Component {
    constructor(props) {
        super(props);
        this.state = { 
          stage: 0
         };
      }

    tryNow() {
        console.log("hello world")
    }

    render(){
        return (
            {step1}
        )
    }    
}

export default Home;
